import React, { useState } from "react";
import { Link } from "react-router-dom";
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';

export default function Carousel() {
 
const imageUrls = [
  {
    imageUrl: "data:image/jpeg;base64,",
    caption: "Anantvedha Student Program",
  },
  {
    imageUrl: "data:image/jpeg;base64,",
    caption: "Anantvedha EdTech Solutions",
  },
  {
    imageUrl: "data:image/jpeg;base64,",
    caption: "Anantvedha ",
  },
];

  const [activeIndex, setActiveIndex] = useState(0);

  const handleNext = () => {
    const nextIndex = (activeIndex + 1) % imageUrls.length;
    setActiveIndex(nextIndex);
  };

  const handlePrev = () => {
    const prevIndex =
      activeIndex === 0 ? imageUrls.length - 1 : activeIndex - 1;
    setActiveIndex(prevIndex);
  };

  return (
    <div
      id="carouselExampleFade"
      className="carousel slide rounded position-relative"
      data-ride="false"
      width="90vw"
    >
      <div className="carousel-inner">
        {imageUrls.map((item, index) => (
          <div
            key={index}
            className={`carousel-item ${index === activeIndex ? "active" : ""}`}
          >
            <img
              className="d-block w-100 img-fluid"
              src={item.imageUrl}
              alt={`Slide ${index + 1}`}
              style={{
                maxWidth: "70%",
                maxHeight: "500px",
                width: "70px",
                margin: "10px auto",
                borderRadius: "5px",
                object:'contain'
              }}
            />
            <div className="carousel-caption">
              <h3>{item.caption}</h3>
              <p>Explore more about Anantvedha</p>
            </div>
          </div>
        ))}
      </div>
      <a
        className="carousel-control-prev align-items-center justify-content-center "
        href="#carouselExampleFade"
        role="button"
        data-slide="prev"
        onClick={handlePrev}
        aria-label="Previous"
      >
          <ArrowBackIosNewIcon style={{ fontSize: 40, color: "black" }} />
      </a>
      <a
        className="carousel-control-next align-items-center justify-content-center"
        href="#carouselExampleFade"
        role="button"
        data-slide="next"
        onClick={handleNext}
        aria-label="Next"
      >
         <ArrowForwardIosIcon style={{ fontSize: 40, color: "black" }} />
      </a>
    </div>
  );
}
